import React from 'react';

const Header = ({ activeTab, onTabChange }) => {
  return (
    <header>
      <nav>
        <ul style={{ listStyleType: 'none', display: 'flex', padding: 0 }}>
          <li
            style={{
              marginRight: '10px',
              cursor: 'pointer',
              fontWeight: activeTab === 'guessr_help' ? 'bold' : 'normal'
            }}
            onClick={() => onTabChange('guessr_help')}
          >
            Guessr_Help
          </li>
          <li
            style={{
              cursor: 'pointer',
              fontWeight: activeTab === 'training' ? 'bold' : 'normal'
            }}
            onClick={() => onTabChange('training')}
          >
            Training
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
